import React from "react";

const HalfArrow = () => {
    return (
        <svg width="4" height="7" viewBox="0 0 4 7" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M1 1L3.5 3.5L1 6" stroke="black" stroke-opacity="0.5" stroke-linecap="round" stroke-linejoin="round"/>
        </svg>
    );
};

export { HalfArrow };
